import React, { Component } from 'react';
import Aux from '../../hoc/Aux/Aux';
import classes from './Summary.module.css';


class Summary extends Component{

    render(){
        let fullSequence = null;
        for(let character in this.props.seq){
            console.log(this.props.seq[character])
            switch(character){
                case('A'):
                    character.fontcolor('red');
                case('G'):
                    character.fontcolor('green');
                case('T'):
                    character.fontcolor('red');
                case('C'):
                    character.fontcolor('')
            }

            fullSequence += character;

        }
        return(
            <Aux>
                <div className={classes.A}>
                <p>{this.props.seq}</p>
                </div>
            </Aux>
        );
    }



};

export default Summary;
